using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The UIDocumentMenuDelegate protocol defines the methods you must implement to track user interactions with a document menu view controller. The document menu calls these methods when the user selects a document picker or dismisses the menu. If the user selects a document picker, set the pickerâ€™s delegate and present it.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIDocumentMenuDelegate_Protocol/index.html#//apple_ref/occ/intf/UIDocumentMenuDelegate"/>    [iOSVersion(8)]    public interface UIDocumentMenuDelegate//: NSObjectProtocol    {        /// <summary>        /// Tells the delegate that the user has selected a document picker from the menu. (required)        /// </summary>        /// <param name="documentMenu">The document menu object that called this method.</param>        /// <param name="didPickDocumentPicker">The document picker that the user selected.</param>        [iOSVersion(8)]        [Export("documentMenu")]        void DocumentMenu(UIDocumentMenuViewController documentMenu, UIDocumentPickerViewController didPickDocumentPicker);                /// <summary>        /// Tells the delegate that the user dismissed the document menu.        /// </summary>        /// <param name="documentMenu">The document menu object that called this method.</param>        [iOSVersion(8)]        [Export("documentMenuWasCancelled")]        void DocumentMenuWasCancelled(UIDocumentMenuViewController documentMenu);    }}